import React from 'react'

class FirstTabs extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <>
                {
          this.props.tabList.map((tab, index) => (
          <div >
              <img src={tab.icon}></img>{tab.user}
              <p>{tab.number}</p>
              <p>{tab.type}</p>
              <img src={tab.upOrDown}></img>
              
              <span color={tab.colorR}>{tab.howMany}</span>
           
          </div>
          ))
        }
            </>
        )
    }

}

export default FirstTabs
